import Item from './item';
import ItemCategory from './itemCategory';
import ItemTicketRecipiente from './itemTicketRecipiente';

class ItemTicket extends Item {
  amount: number;
  
  constructor(id: number, title: string, price: number, pictureUrl: string, category: ItemCategory, amount: number) {
    super(id, title, price, pictureUrl, category);
    this.amount = amount;
  }

  getTicketTitle(): string {
    return super.title;
  } 
}

export default ItemTicket;
